//[战斗][技能]被升级技能概率加成package cn.mxz;public class SkillHostTemplet implements HostTemplet {	/** 	 * 品阶等级组合列 	 */	private String spetLv;	/** 	 * 技能品质 	 */	private int formationSpet;	/** 	 * 技能等级 	 */	private int formationLv;	/** 	 * 基础概率 	 */	private float hostPro;	/** 	 * 必定升级的总概率 	 */	private float sumPro;	/** 	 * 金钱消耗 	 */	private int cashNeed;	/**	 * 品阶等级组合列	 */	void setSpetLv(String spetLv) {		this.spetLv = spetLv;	}	/**	 * 品阶等级组合列	 */	public String getSpetLv() {		return this.spetLv;	}	/**	 * 技能品质	 */	void setFormationSpet(int formationSpet) {		this.formationSpet = formationSpet;	}	/**	 * 技能品质	 */	public int getFormationSpet() {		return this.formationSpet;	}	/**	 * 技能等级	 */	void setFormationLv(int formationLv) {		this.formationLv = formationLv;	}	/**	 * 技能等级	 */	public int getFormationLv() {		return this.formationLv;	}	/**	 * 基础概率	 */	void setHostPro(float hostPro) {		this.hostPro = hostPro;	}	/**	 * 基础概率	 */	public float getHostPro() {		return this.hostPro;	}	/**	 * 必定升级的总概率	 */	void setSumPro(float sumPro) {		this.sumPro = sumPro;	}	/**	 * 必定升级的总概率	 */	public float getSumPro() {		return this.sumPro;	}	/**	 * 金钱消耗	 */	void setCashNeed(int cashNeed) {		this.cashNeed = cashNeed;	}	/**	 * 金钱消耗	 */	public int getCashNeed() {		return this.cashNeed;	}}